script: |
  super -f text -I q12095.spq | sort > q12095.out

inputs:
  - name: q12095.spq
    data: |
      SELECT - 88 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT - col1 NOT IN ( 29, CAST ( NULL AS INTEGER ), + + col1 * + - 84 * + col2 * - + 26 / col1 + - + col0, col1, - 55 );
  - name: tab0

outputs:
  - name: q12095.out
    data: |
